commit_message:
Make parameterized.named_parameters work better with other decorators.

parameterized decorators should be put before other decorators.

Example:
  @parameterized.named_parameters(('foo', 1), ('bar', 2))
  @decorator
  def test_something(self, param):
    # ...

Previously, this may result in no tests being run. That's because it uses `decorator`'s returned method's __name__ to generate the test method name. Instead, it should use the original test name `test_something`.

